import React, { Component } from 'react';
import './LeftVerticalMenu.scss';

export default class LeftVerticalMenu extends Component {
  render () {
    return (
      <nav className="left-vertical-menu">
        <ul>
          <li>Follow The GRIP Movement</li>
        </ul>
      </nav>
    );
  }
}
